import React, { useEffect } from "react";
import Header from "./Header";
import Main from "./Main";
function App() {
  useEffect(() => {
    fetch("http://localhost:9000/questions")
      .then((res) => res.json())
      .then((data) => console.log(data))
      .then((err) => console.error("ERROR"));
  }, []);
  return (
    <div className='app'>
      <Header />
      <Main>
        <p>15</p>
        <p>questions</p>
      </Main>
    </div>
  );
}

export default App;
